import React from "react";

import PropsMoviesData from "./PropsCard";
const PropsMovies = () => {
  return (
    <>
      <div className="container-fluid">{
        PropsMoviesData.map((elem)=>(
            <>
            <div>{elem.n}</div>
            </>
        ))
      }</div>
      {/* <PropsData/> */}
    </>
  );
};

export default PropsMovies;
